import React from "react";
import "./Header.css";
const Header = ({ name, bgColor }) => {
  return (
    <React.Fragment>
      <div>This is a header {name}</div>
      {/* <div className="header-color">This is a color {bgColor}</div> */}
    </React.Fragment>
  );
};

export default Header;
